import React from 'react'
import './Coins.css'


const Coin = ({ title, url }) => {
    return(
      <div class="card bg-dark text-white">
      <img src={url} class="card-img" alt="..." />
      <div class="card-img-overlay">
        <h5 class="card-title">{title}</h5>
      </div>
    </div>
    )
}

export default Coin;
